import React from "react";

function HorizontalnaLista(listItems)
{
    return(
        <ul>
            <li>{listItems.prvi}</li>
            <li>{listItems.drugi}</li>
            <li>{listItems.treci}</li>
            <li>{listItems.cetvrti}</li>
        </ul>
    );
}

export default HorizontalnaLista;
